description:
Starring: Kimberly Kane, Anthony Rosano, Ashlynn Brooke, Audrey Bitoni, Aurora Snow, Charley Chase, Jackie Daniels, Gracie Glam, Angelica Raven, Rod Fontana, Evan Stone.

Federal agents Dana Scully (Kimberly Kane) and Fox Mulder (Anthony Rosano) are sent to investigate a series of mysterious homicides. A common thread of the murders are the occult images and symbols found at the scene of each crime. With time against them, Scully and Mulder must solve the riddle that will eventually lead them to someone or something they have never encountered before. The truth is out that &quot;The Sex Files: A Dark XXX Parody&quot; is the hottest movie of the year! Suspenseful, sexy, awesome! Digital Sin presents a Revolution X film, The Sex Files: A Dark XXX Parody.

